import { Component } from "react";
import { Glide } from "react-glide";
import data from "../public/json/data.json";

class Carrousel extends Component {
  constructor(props){
    super(props)
  }
  render(){
    const images = data.work;

    return (
      <Glide
        height={400}
        width={400}
        autoPlay={true}
        autoPlaySpeed={2000}
        dots={true}
        infinite={true}
        onSlideChange={() => console.log("slide changed")}
      >
        {images.map((image, i) => {
          <img src={image.img} />
        })}      
      </Glide>
    );
  }
}

